import React from "react";
import "./Menuoption.css";
import { Link } from "react-router-dom";

const Menuoption = ({ characters, url }) => {
    return (
        <Link
        className="app__character-link"
        to={`/`}
      >
        <li className="menuItem">{characters}</li>
        </Link>
    );
}

export default Menuoption;
